import React from 'react'

type Props = {}

type Company = {}

const configs = [
    {
        label: "Год",
        render: (company: Company) => company.year
    },
    {
        label: "Доход",
        render: (company: Company) => company.income
    }
]
const Table = (props: Props) => {
    const renderedRow = data.map((company) => {
        return(
            <tr key={company.cik}>
                {configs.map((val:any) => {
                    return (
                        <td className='p-4 whitespace-nowrap text-sm font-normal text-gray-900'>{val.render(company)}</td>
                    );
                })}
            </tr>
        );
    })
  return <div>Table</div>
}

export default Table
